			shellScript = "#!/bin/bash\n\n# Copy images into the application directory.  Since perforce can't\n# handle filenames with '@' in them, we need to call the high-res\n# images <imagename>_2x.png, and then rename them <imagename>@2x.png.\n# Based on //depot/googlemac/iPhone/EmSea/Tools/copy_assets.sh\n\nfind . -name '*_2x.png' | while read src_name; do\nfilename=`basename $src_name`\nif [[ $src_name =~ _2x.png$ ]]; then\ndest_name=\"${BUILT_PRODUCTS_DIR}/${PRODUCT_NAME}.app/${filename/_2x.png/@2x.png}\"\nelse\ndest_name=\"$filename\"\nfi\nif [ $src_name -nt $dest_name ]; then\necho cp $src_name $dest_name\ncp -f \"$src_name\" \"$dest_name\"\nfi\ndone";
			showEnvVarsInLog = 0;
		};
